import React from 'react';
import './Registration.css';

const Registration = () => {
    return (
        <div className='process'>
            <h1>Registration Process</h1>
            <div>
                <ol>
                    <li>Go to the Events Page</li>
                </ol>
            </div>
        </div>
    )
}

export default Registration
